import React from 'react';
import { Checkbox } from 'semantic-ui-react'


const SelectMetric = ({keys, onSelect}) => {

    const ckb = keys.map( (k, i) => <Checkbox toggle label={k} style={{marginBottom:15, display: 'block'}} key={i} onChange={(e, data) => onSelect(i, data)}/> );

    return(
        <div>
            <p>Metrics</p>
            {ckb}
        </div>
    )
}

export default SelectMetric
